  false,\n\t\"url\": null,\n\t\"notes\": \"EM302 multibeam data will be collected
  24 hours a day and will be gathered over previously unexplored regions. Data will
  be used to better understand the bathymetry of the Puerto Rican trench and allow
  reconnaissance of the region prior to the ROV cruise. Multibeam operations within
  5 miles of land in priority area 1 will be conducted during daylight hours.  XBT
  casts will be conducted at an interval defined by prevailing oceanographic conditions,
  but not to exceed 6 hours. XBT data will be used to correct the sound velocity of
  the multibeam data. Additionally, EK 60 (single beam) and sub-bottom profile data
  will be collected 24 hours per day.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
